import {FETCH_REPORT_BY_PLAYER_ID} from './actionType'
import axios from 'axios'

const token = localStorage.getItem("userToken");
const userRegion = localStorage.getItem("userRegion")
console.log(userRegion)

export const fetchReportByPlayerUsern = (username) => dispatch => {
    const url = 'http://localhost:8080/api/v1/reports/players/Apolaccio?region=euw'
    axios.get(url)
        .then(res =>
            dispatch({
                type: FETCH_REPORT_BY_PLAYER_ID,
                payload: res.data
            })
        );   
};
